import { FunctionComponent } from 'react';

import { Props } from './index';

import StyledComponent from './styles';

const LayoutLogo: FunctionComponent<Props> = ({ }) => ((
    <StyledComponent
        className="layout-logo"
    >
        <a href="/">
            SoccerScores
        </a>
    </StyledComponent>
));

export default LayoutLogo;
